import React from 'react';
import './App.css';
import Particles from 'react-particles-js';

const particleParams = {
  particles: {
          number: {
              value: 60,
              density: {
                  enable: true,
                  value_area: 1500
              }
          },
          line_linked: {
              enable: true,
              opacity: 0.02
          },
          move: {
              direction: "right",
              speed: 0.05
          },
          size: {
              value: 1
          },
          opacity: {
              anim: {
                  enable: true,
                  speed: 1,
                  opacity_min: 0.05
              }
          }
      },
      interactivity: {
          events: {
              onhover: {
                  enable: true,
                  mode: "repulse"
              }
          },
          modes: {
              repulse: {
                  distance: 30
              }
          }
      },
      retina_detect: true
}

function App() {
  return (
    <div>
      <h1>Hello, world!</h1>
      <Particles
    params={{
      "particles": {
          "number": {
              "value": 60,
              "density": {
                  "enable": true,
                  "value_area": 1500
              }
          },
          "line_linked": {
              "enable": true,
              "opacity": 0.02
          },
          "move": {
              "direction": "right",
              "speed": 0.05
          },
          "size": {
              "value": 1
          },
          "opacity": {
              "anim": {
                  "enable": true,
                  "speed": 1,
                  "opacity_min": 0.05
              }
          }
      },
      "interactivity": {
          "events": {
              "onclick": {
                  "enable": true,
                  "mode": "push"
              }
          },
          "modes": {
              "push": {
                  "particles_nb": 1
              }
          }
      },
      "retina_detect": true
  }} />
    </div>
  );
}

export default App;
